        instance.close();



      };

      const handleOpenNav = () => {
        let sidenav = document.querySelector("#slide-out");
        let instance = M.Sidenav.getInstance(sidenav);
        instance.open();

      }


    return (
        <div>

    <nav class="nav-extended">
    <div class="nav-wrapper">
